local scale = 0
local screenWidth = 240
local screenHeight = 136
local fontWidth = 6
local fontHeight = 6
function drawScaledText(x, y, text, scale,col,skew)
    for i = 1, #text do
        local c = text:sub(i, i)
        local charCode = c:byte()
        for j = 0, fontHeight - 1 do
            for k = 0, fontWidth - 1 do
                local pixel = 0x14604+charCode*8+j
                local mask = (1 << (k))
                local color = (peek(pixel) & mask) > 0 and col or 0
                if color > 0 then
                			if (skew == 1) then
																				x = x + (y - mask) / 32
																			end
                    rect(x + k * scale, y + j * scale, scale*1.6, scale*1.6, color)
                end
            end
        end
        x = x + fontWidth * scale
    end
end

function zoomfont(text,fW,fH,sc)
				fontWidth = fW
				fontHeight = fH
    local textWidth = #text * fontWidth * scale
    local textHeight = fontHeight * scale
    local centerX = math.floor((screenWidth - textWidth) / 2)
    local centerY = math.floor((screenHeight - textHeight) / 2)

				scale = sc
				for i=0,8 do 
    drawScaledText(4+centerX, centerY, text, scale+math.cos(time()*0.004+i*1.1)*0.4,5-i/4,1)
				end
    drawScaledText(4+centerX, centerY, text, scale,3,1)

end

local function xorshift32(seed)
  local x = seed
  local function next()
    x = x ~ (x << 13)
    x = x ~ (x >> 17)
    x = x ~ (x << 5)
    return x
  end
  return next
end

-- create a new pseudorandom number generator
local rand = xorshift32(7)


function noise()

for i = 0, 15 do
  -- Set the sprite number
  local sprite_num = i

  -- Calculate the probability of each pixel being on
  local prob = (i) / 16.0

  -- Set each pixel based on its probability of being on
  for y = 0, 7 do
    local byte_value = 0
    for x = 0, 7 do
      if rand() < prob then
        -- Set the pixel to white
        byte_value = byte_value + 2^(7-x)
      end

    end
  -- Write the byte to screen memory
    poke((0x4000 + sprite_num * 8) + y, byte_value)
  end
end

end








