function unrle(imz,im)
	local current = -1
	local runlength = 0
	local j = 1
	for i=1,#imz,2 do
		local run  = imz[i+0]
		local val  = imz[i+1]
		for ii=0,run-1 do 
			im[j] = val
			j = j + 1
		end
	end
	return j-4000
end

function getcodeindex(code)
	for i = 1, #codes do
		if string.sub(codes,i,i) == code then
			return i-1
		end
	end
end

function unrle_str(imz,im)
	local current = -1
	local runlength = 0
	local j = 1
	for i=1,#imz-2,2 do
		local run  = getcodeindex(string.sub(imz,i,i))
		local val  = 32-getcodeindex(string.sub(imz,i+1,i+1))
		for ii=0,run-1 do 
			im[j] = val
			j = j + 1
		end
	end
	return j-4000
end


